import React, { Component } from "react";

export default class Talent extends Component {
  render() {
    return (
      <div>
        <tr>
          <th scope="row">1</th>
          <td>{this.props.randomHero}</td>
          <td>{this.props.randomTalent}</td>
        </tr>
      </div>
    );
  }
}
